'use strict';
let MessageType = require('./MessageType.js');
let UpdateCommandType = require('./UpdateCommandType.js');
class ClientMessageUpdateMessage {
    message;
    constructor() {
        this.message = null;
    }
    getType() {
        return MessageType.ClientMessage;
    }
    getClientMessage() {
        return this.message;
    }
    getUpdateCommand() {
        return UpdateCommandType.INSERT;
    }
}
module.exports = ClientMessageUpdateMessage
